import axios from "axios";

import {
    GET_ERRORS,
    SET_CURRENT_PLAYER,
    PLAYER_LOADING
} from "./types";

export const loadLolacc = req => {
    axios
        .get("http://localhost:8000/riotapi/lolacc", req);
        
}

export const loadRankedstats = req => {
    console.log(req.body)
    axios
        .get("http://localhost:8000/riotapi/rankedstats", req);
}
